		<script>
			$(function() {
				var mode = 0;

				function highlight(sel) {
					$("." + sel).each(function(i, obj) {
						$(obj).find('rect').addClass('highlighted-rect');
						$(obj).find('text').addClass('highlighted-text');
					});
				}
				
				function removeHighlight(sel) {
					$("." + sel).each(function(i, obj) {
						$(obj).find('rect').removeClass('highlighted-rect');
						$(obj).find('text').removeClass('highlighted-text');
					});
				}
